import React from "react";

const Contact = () => {
  return (
    <div className="page-container">
      <h1>Contact Us</h1>
      <p>Email: contact@elegantjewelry.com</p>
      <p>Phone: +91 12345 67890</p>
      <p>Address: 123 Jewelry Street, Your City, India</p>
    </div>
  );
};

export default Contact;
